webpackJsonp([0xe493c095fbe3],{1204:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/git-101-force-sensitive-to-jedi-padawan/index.md absPath of file >>> MarkdownRemark",html:'<p><strong>What is Git? What does it do, how does it work, how does it fit into my workflow?</strong></p>\n<p>If you\'ve ever wondered about the answers to any of those things, this session is designed for you, my friend.</p>\n<p>Starting with the assumption of no prior knowledge of Git or even of version control, we\'ll cover the technology at a theoretical level, its manifestation in your projects in the physical level, and your development workflow at the practical level - by which time you\'ll be ready to step out into the world, secure in your knowledge of what the heck Git is, and ready to use it in your projects - and you\'ll marvel at how you ever worked without it.</p>\n<iframe style="border: 1px solid #CCC; border-width: 1px 1px 0; margin-bottom: 5px; max-width: 100%; width:100%" src="https://www.slideshare.net/slideshow/embed_code/33414475" width="427" height="356" frameborder="0" marginwidth="0" marginheight="0" scrolling="no" allowfullscreen="allowfullscreen"> </iframe>\n<div style="margin-bottom: 5px;"><strong> <a title="Git 101: Force-sensitive to Jedi padawan" href="https://www.slideshare.net/psyked/git-101-forcesensitive-to-jedi-padawan" target="_blank">Git 101: Force-sensitive to Jedi padawan</a> </strong> from <strong><a href="https://www.slideshare.net/psyked" target="_blank">James Ford</a></strong></div>',frontmatter:{title:"Git 101: Force-sensitive to Jedi padawan",date:"April 11, 2014",tags:["presentations"],url:null}}},pathContext:{}}}});
